import React from 'react'
import "./App.css";
import { useState } from 'react';
 function Mark() {
    const [ ta,setx]=usestate('0')
    const [ en,sety]=usestate('0')
    const [ ma,setm]=usestate('0')
    const [ sc,sets]=usestate('0')
    const [ so,seti]=usestate('0')
  return (
    <>
    <center> student mark</center>
    <label  >:tamil <input type="number" value={x} onChange={(e)=>setx(e.target.value)}/></label>
    <label> :english <input type="number" value={y} onChange={(e)=>sety(e.target.value)}/></label>
    <label>:maths <input type="number" value={m} onChange={(e)=>sety(e.target.value)}/></label>
    <label> :science<input type="number" value={s} onChange={(e)=>sety(e.target.value)}/></label>
    <label> :social<input type="number" value={i} onChange={(e)=>sety(e.target.value)}/></label>
      {parseInt(x)+parseInt(y)+parseInt(m)+parseInt(s)+parseInt(i)}<br></br>
      {parseInt(x)+parseInt(y)+parseInt(m)+parseInt(s)+parseInt(i)/5}<br></br>
      
    
    </>
  )
}
